  summary: Releases all resources used by the <xref href="System.Printing.PrintSystemObjectPropertiesChangedEventArgs"></xref> object.
  remarks: "Call <xref:System.Printing.PrintSystemObjectPropertiesChangedEventArgs.Dispose> when you are finished using the <xref:System.Printing.PrintSystemObjectPropertiesChangedEventArgs>. The <xref:System.Printing.PrintSystemObjectPropertiesChangedEventArgs.Dispose> method leaves the <xref:System.Printing.PrintSystemObjectPropertiesChangedEventArgs> in an unusable state. After calling <xref:System.Printing.PrintSystemObjectPropertiesChangedEventArgs.Dispose>, you must release all references to the <xref:System.Printing.PrintSystemObjectPropertiesChangedEventArgs> so that the garbage collector can reclaim the memory that the <xref:System.Printing.PrintSystemObjectPropertiesChangedEventArgs> was occupying. For more information, see [Cleaning Up Unmanaged Resources](~/docs/standard/garbage-collection/unmanaged.md) and [Implementing a Dispose Method](~/docs/standard/garbage-collection/implementing-dispose.md).  \n  \n> [!NOTE]\n>  Always call <xref:System.Printing.PrintSystemObjectPropertiesChangedEventArgs.Dispose> before you release your last reference to the <xref:System.Printing.PrintSystemObjectPropertiesChangedEventArgs>. Otherwise, the resources it is using are not freed until the garbage collector calls the `Finalize` method of the <xref:System.Printing.PrintSystemObjectPropertiesChangedEventArgs> object."
